    "Calling up current system data at too short intervals can lead to very high CPU consumption, especially under Windows. To switch off individual queries, set the slider to 0.": {"en": "Requesting current system data at too short intervals can lead to very high CPU consumption, especially under Windows. To switch off individual queries, set the slider to 0.", "de": "Das Aufrufen aktueller Systemdaten in zu kurzen Intervallen kann, insbesondere unter Windows, zu sehr hoher CPU Auslastung führen. Um individuelle Abfragen abzuschalten, Regler auf 0 stellen.", "ru": "Заправка текущих системных данных с слишком короткими промежутками может привести к очень высокому потреблению процессора, особенно в Windows. Чтобы выключить отдельные запросы, установите ползунок на 0.", "pt": "Solicitar dados atuais do sistema em intervalos muito curtos pode levar a um consumo muito alto da CPU, especialmente no Windows. Para desligar as consultas individuais, defina o controle deslizante para 0.", "nl": "Het aanvragen van huidige systeemgegevens met te korte intervallen kan leiden tot een zeer hoog CPU -verbruik, vooral onder Windows. Om individuele vragen uit te schakelen, stelt u de schuifregelaar in op 0.", "fr": "La demande de données système actuelles à des intervalles trop courts peut entraîner une consommation de processeur très élevée, en particulier sous Windows. Pour éteindre les requêtes individuelles, définissez le curseur sur 0.", "it": "La richiesta di dati di sistema corrente a intervalli troppo brevi può portare a un consumo di CPU molto elevato, in particolare sotto Windows. Per disattivare le singole query, impostare il cursore su 0.", "es": "Solicitar datos actuales del sistema a intervalos demasiado cortos puede conducir a un consumo de CPU muy alto, especialmente en Windows. Para apagar consultas individuales, configure el control deslizante en 0.", "pl": "Żądanie bieżących danych systemowych w zbyt krótkich odstępach czasu może prowadzić do bardzo wysokiego zużycia procesora, szczególnie w systemie Windows. Aby wyłączyć poszczególne zapytania, ustaw suwak na 0.", "uk": "Запит поточних даних системних даних через занадто короткі проміжки часу може призвести до дуже високого споживання процесора, особливо в Windows. Щоб вимкнути окремі запити, встановіть повзунок на 0.", "zh-cn": "以太短的间隔要求当前的系统数据可能会导致CPU消耗量很高，尤其是在Windows下。要关闭各个查询，请将滑块设置为0。"},
