    "Ideally, inquiries should be made in English because some developers come from abroad and are not proficient in the local language.": {"en": "Ideally, inquiries should be made in English because some developers come from abroad and are not proficient in the local language.", "de": "Idealerweise sollten Anfragen auf Englisch gestellt werden, denn einige Entwickler kommen aus dem Ausland und sind der Landessprache nicht mächtig.", "ru": "В идеале, запросы должны быть сделаны на английском языке, потому что некоторые разработчики приезжают из -за рубежа и не являются опытными на местном языке.", "pt": "Idealmente, as consultas devem ser feitas em inglês, porque alguns desenvolvedores vêm do exterior e não são proficientes no idioma local.", "nl": "In het ideale geval moeten er in het Engels vragen worden gesteld omdat sommige ontwikkelaars uit het buitenland komen en niet bedreven zijn in de lokale taal.", "fr": "Idéalement, des demandes de renseignements devraient être faites en anglais car certains développeurs viennent de l'étranger et ne sont pas compétents dans la langue locale.", "it": "Idealmente, le richieste dovrebbero essere fatte in inglese perché alcuni sviluppatori provengono dall'estero e non sono competenti nella lingua locale.", "es": "Idealmente, las consultas deben hacerse en inglés porque algunos desarrolladores vienen del extranjero y no son competentes en el idioma local.", "pl": "Idealnie zapytania powinny być dokonywane w języku angielskim, ponieważ niektórzy programiści pochodzą z zagranicy i nie są biegli w języku lokalnym.", "uk": "В ідеалі запити повинні бути зроблені англійською мовою, оскільки деякі розробники приходять з -за кордону і не володіють місцевою мовою.", "zh-cn": "理想情况下，应该以英语进行查询，因为一些开发人员来自国外，并且不精通当地语言。"},
    "If links are missing or wrong, please send us an e-mail to": {"en": "If links are missing or wrong, please send us an e-mail to", "de": "Wenn Links fehlen oder falsch sind, senden Sie uns bitte eine E-Mail an", "ru": "Если ссылки отсутствуют или неправильно, отправьте нам электронное письмо на", "pt": "Se os links estiverem ausentes ou errados, envie-nos um e-mail para", "nl": "Als links ontbreken of verkeerd zijn, stuur ons dan een e-mail naar", "fr": "Si les liens sont manquants ou erronés, veuillez nous envoyer un e-mail à", "it": "Se i collegamenti mancano o sbagliano, ti preghiamo di inviarci un'e-mail", "es": "Si faltan los enlaces o no están mal, envíenos un correo electrónico a", "pl": "Jeśli linki brakuje lub źle, wyślij nam e-mail do", "uk": "Якщо посилання відсутні або неправильні, надішліть нам електронний лист до", "zh-cn": "如果链接缺失或错误，请给我们发送电子邮件至"},
