    "To better investigate the problem, the following data will be provided to the developer.": {"en": "To better investigate the problem, the following data will be provided to the developer.", "de": "Zur besseren Untersuchung des Problems werden dem Entwickler folgenden Daten zur Verfügung gestellt.", "ru": "Чтобы лучше исследовать проблему, разработчику будут предоставлены следующие данные.", "pt": "Para investigar melhor o problema, os seguintes dados serão fornecidos ao desenvolvedor.", "nl": "Om het probleem beter te onderzoeken, worden de volgende gegevens aan de ontwikkelaar verstrekt.", "fr": "Pour mieux étudier le problème, les données suivantes seront fournies au développeur.", "it": "Per indagare meglio il problema, i seguenti dati saranno forniti allo sviluppatore.", "es": "Para investigar mejor el problema, se proporcionarán los siguientes datos al desarrollador.", "pl": "Aby lepiej zbadać problem, deweloperowi zostaną przekazane następujące dane.", "uk": "Щоб краще дослідити проблему, розробнику будуть надані наступні дані.", "zh-cn": "为了更好地调查问题，将向开发人员提供以下数据。"},
    "To create messages about adapters or adapter requests, you need a Github account and a token with repo access.": {"en": "To create messages about adapters or adapter requests, you need a GitHub account and a token with repository access.", "de": "Um Meldungen zu Adaptern oder Adapteranforderungen zu erstellen, benötigen Sie ein Github-Konto und ein Token mit Repo-Zugriff.", "ru": "Чтобы создать сообщения об адаптерах или запросах адаптера, вам нужна учетная запись GitHub и токен с доступом к репозиторию.", "pt": "Para criar mensagens sobre solicitações de adaptadores ou adaptadores, você precisa de uma conta do GitHub e um token com acesso ao repositório.", "nl": "Om berichten te maken over adapters of adapterverzoeken, hebt u een Github -account en een token nodig met repository -toegang.", "fr": "Pour créer des messages sur les adaptateurs ou les demandes d'adaptateur, vous avez besoin d'un compte GitHub et d'un jeton avec accès au référentiel.", "it": "Per creare messaggi su adattatori o richieste di adattatori, è necessario un account GitHub e un token con accesso al repository.", "es": "Para crear mensajes sobre adaptadores o solicitudes de adaptadores, necesita una cuenta GitHub y un token con acceso al repositorio.", "pl": "Aby tworzyć wiadomości o adapterach lub żądaniach adapterów, potrzebujesz konta GitHub i tokena z dostępem do repozytorium.", "uk": "Для створення повідомлень про адаптери або запити на адаптер, вам потрібен обліковий запис Github та маркер із доступом до сховища.", "zh-cn": "要创建有关适配器或适配器请求的消息，您需要一个github帐户和一个具有存储库访问的令牌。"},
    "To read news or forum, you need a free API Key if your ioBroker installation can be reached via a hostname, such as iobroker: 8081 or something similar. For IP access it is not needed.": {"en": "To read news or forum, you need a free API Key if your ioBroker installation can be reached via a hostname, such as iobroker: 8081 or something similar. For IP access it is not needed.", "de": "Um News- oder Forumseinträge zu lesen, benötigen Sie einen kostenlosen API-Key, wenn ioBroker über einen Hostnamen aufgerufen wird (wie z.B. iobroker:8081 oder ähnliches). Für den IP-Zugriff ist kein Key erforderlich.", "ru": "Чтобы прочитать новости или форум, вам нужен бесплатный ключ API, если ваша установка iobroker может быть достигнута с помощью имени хоста, такого как iobroker: 8081 или что -то в этом роде. Для доступа к IP он не нужен.", "pt": "Para ler notícias ou fórum, você precisará de uma chave de API gratuita se a instalação do IOBROKER puder ser contatada por meio de um nome de host, como o iobroker: 8081 ou algo semelhante. Para acesso IP, não é necessário.", "nl": "Om nieuws of forum te lezen, hebt u een gratis API -sleutel nodig als uw iobroker -installatie kan worden bereikt via een hostnaam, zoals iObroker: 8081 of iets dergelijks. Voor IP -toegang is het niet nodig.", "fr": "Pour lire les nouvelles ou le forum, vous avez besoin d'une clé API gratuite si votre installation IoBroker peut être atteinte via un nom d'hôte, comme IOBroker: 8081 ou quelque chose de similaire. Pour l'accès IP, il n'est pas nécessaire.", "it": "Per leggere notizie o forum, è necessario una chiave API gratuita se è possibile raggiungere l'installazione di IoBroker tramite un nome host, come IoBroker: 8081 o qualcosa di simile. Per l'accesso IP non è necessario.", "es": "Para leer noticias o foro, necesita una clave API gratuita si se puede comunicarse con su instalación de Iobroker a través de un nombre de host, como Iobroker: 8081 o algo similar. Para el acceso IP no es necesario.", "pl": "Aby przeczytać wiadomości lub forum, potrzebujesz bezpłatnego klucza API, jeśli instalacja IOBRoker można dotrzeć za pomocą nazwy hosta, takiego jak IOBRAKER: 8081 lub coś podobnego. Aby uzyskać dostęp do IP, nie jest to potrzebne.", "uk": "Щоб прочитати новини чи форум, вам потрібен безкоштовний ключ API, якщо ваша установка iObroker можна отримати через ім'я хоста, наприклад, iobroker: 8081 або щось подібне. Для доступу до IP він не потрібен.", "zh-cn": "要阅读新闻或论坛，如果可以通过主机名（例如iobroker：8081或类似内容）达到iObroker安装，则需要免费的API密钥。对于IP访问，不需要。"},
