    "on save adapter restarts with new config immediately": {"en": "when saving, adapter restarts with new config immediately", "de": "Beim Speichern von Einstellungen der Adapter wird sofort neu gestartet.", "ru": "При сохранении немедленно адаптер перезагружается с новой конфигурацией", "pt": "Ao salvar, o adaptador reinicia com uma nova configuração imediatamente", "nl": "Bij het opslaan begint de adapter met een nieuwe configuratie onmiddellijk", "fr": "Lors de l'enregistrement, l'adaptateur redémarre immédiatement avec une nouvelle configuration", "it": "Quando si salva, l'adattatore si riavvia immediatamente con una nuova configurazione", "es": "Al guardar, el adaptador se reinicia con la nueva configuración inmediatamente", "pl": "Podczas zapisywania adapter ponownie uruchamia się z nową konfiguracją", "uk": "Під час збереження негайно перезапускає адаптер з новою конфігурацією", "zh-cn": "保存时，适配器立即使用新配置重新启动"},
    "only for experts": {                             "en": "Attention !! These adapters may be in a very early stage and it is not recommended to install them in a production system.", "de": "Achtung!! Diese Adapter können sich in einem sehr frühen Stadium befinden und es wird davon abgeraten, diese in einem Produktivsystem zu installieren.", "ru": "Внимание !! Эти адаптеры могут находиться на очень ранней стадии, и не рекомендуется устанавливать их в производственной системе.", "pt": "ATENÇÃO !! Esses adaptadores podem estar em um estágio muito inicial e não é recomendável instalá -los em um sistema de produção.", "nl": "Aandacht !! Deze adapters kunnen zich in een zeer vroeg stadium bevinden en het wordt niet aanbevolen om ze in een productiesysteem te installeren.", "fr": "Attention !! Ces adaptateurs peuvent être à un stade très précoce et il n'est pas recommandé de les installer dans un système de production.", "it": "Attenzione !! Questi adattatori potrebbero trovarsi in una fase molto precoce e non si consiglia di installarli in un sistema di produzione.", "es": "Atención !! Estos adaptadores pueden estar en una etapa muy temprana y no se recomienda instalarlos en un sistema de producción.", "pl": "Uwaga !! Adaptery te mogą znajdować się na bardzo wczesnym etapie i nie zaleca się ich instalowania w systemie produkcyjnym.", "uk": "Увага !! Ці адаптери можуть бути на дуже ранній стадії, і не рекомендується встановлювати їх у виробничій системі.", "zh-cn": "注意力 ！！这些适配器可能处于很早的阶段，不建议将其安装在生产系统中。"},
